const parseResponse = (body) => {
  const parsed = {};
  Object.keys(body).forEach(k => {
    if(k.match(/\d+\../)) {
      parsed[k.replace(/\d+\../,'')] = body[k];
    }
  });
  return parsed;
};

if(response_body_raw_map) {
  const root = Object.keys(response_body)[0];
  done({
    response_body: parseResponse(response_body[root])
  });
}

